tables.table_schema:
CREATE TABLE Quantum_Algorithms (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255) NOT NULL,
    execution_time FLOAT NOT NULL
);

CREATE TABLE quantum_execution_time (
    algorithm_id INT,
    execution_time FLOAT,
    status VARCHAR(50)
);

CREATE TABLE quantum_algorithms (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(100),
    creator VARCHAR(100),
    release_date DATE
);

CREATE TABLE quantum_performance_optimization (
    optimization_id INT,
    algorithm_id INT,
    optimization_strategy VARCHAR(100),
    improvement_percentage FLOAT
);

CREATE TABLE Quantum_Algorithms (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255) NOT NULL,
    execution_time DECIMAL(10,3),
    optimized BOOLEAN
);

CREATE TABLE Quantum_Users (
    user_id INT PRIMARY KEY,
    user_name VARCHAR(50) NOT NULL,
    user_email VARCHAR(100),
    user_role VARCHAR(20)
);

CREATE TABLE quantum_algorithms (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255) NOT NULL,
    execution_time DECIMAL(10,5) NOT NULL
);

CREATE TABLE users (
    user_id INT PRIMARY KEY,
    user_name VARCHAR(255) NOT NULL,
    email VARCHAR(255) NOT NULL,
    role VARCHAR(50) NOT NULL
);

CREATE TABLE results (
    result_id INT PRIMARY KEY,
    execution_id INT,
    result_data TEXT,
    CONSTRAINT fk_execution_id FOREIGN KEY (execution_id) REFERENCES executions (execution_id)
);

CREATE TABLE optimization_logs (
    log_id INT PRIMARY KEY,
    execution_id INT,
    log_message TEXT,
    CONSTRAINT fk_execution_id FOREIGN KEY (execution_id) REFERENCES executions (execution_id)
);
